import { useState } from "react";

function App() {
  return (
    <div className="App">
      <MainHeader>
        <Logo></Logo>
        <Heading></Heading>
        <Search></Search>
      </MainHeader>
    </div>
  );
}

export default App;

function MainHeader({ children }) {
  return <nav>{children}</nav>;
}

function Logo() {
  return (
    <div className="logo">
      <img src="Logo.png" alt=""></img>
    </div>
  );
}
function Search() {
  const [search, setSearch] = useState("");
  return (
    <input
      className="search"
      type="text"
      placeholder="Search here...."
      value={search}
      onChange={(e) => setSearch(e.target.value)}
    ></input>
  );
}

function Heading() {
  return (
    <header className="header">
      <h1 style={{ color: "white" }}>ShopHubâ€¢</h1>
    </header>
  );
}
